class Solution:
    def removeDuplicates(self, s: str) -> str:
        mystack = []
        for i in range(len(s)):
            if mystack and mystack[-1] == s[i]:
                mystack.pop()
            else:
                mystack.append(s[i])
        return "".join(mystack)



    def removeDuplicates2(self, s: str) -> str:
        found = 1
        while found > 0:
            found = 0
            i = 0
            res = ""
            while i < len(s) - 1:
                if s[i] != s[i+1]:
                    if res != "" and res[len(res)-1] == s[i]:
                        res = res[:-1]
                    else:
                        res += s[i]
                    i += 1
                else:
                    found += 1
                    i += 2
                if i == len(s) - 1:
                    res += s[i]
            if found > 0:
                s = res
        return s


